import Login from '@/components/Login';
import api from "../utils/api";
export default {
  components: {
    Login: Login
  },
  data: function data() {
    return {
      loginTitle: '登陆',
      isLoading: false
    };
  },
  methods: {
    postLogin: function postLogin(e) {
      var _this = this;

      if (e && e.number && e.pswd) {
        this.isLoading = !this.isLoading;
        this.loginTitle = '登陆中...';
        var params = {
          url: '/site/login',
          form: {
            username: e.number,
            password: e.pswd
          }
        };
        api.postSiteLogin(params).then(function (res) {
          if (res.status === 200) {
            if (res.data.code === 200) {
              _this.loginTitle = '登陆成功';
              _this.isLoading = !_this.isLoading;
              window.localStorage.setItem('token', res.data.data.access_token);

              _this.$router.push('/home');
            } else {
              _this.loginTitle = '登陆';
              _this.isLoading = !_this.isLoading;

              _this.$message("".concat(res.data.message));
            }
          } else {
            _this.$message('网络出现问题，请稍后重试！');
          }
        });
      } else {
        this.$message('请输入用户名和密码！');
      }
    }
  },
  created: function created() {}
};
